    pragma solidity ^0.8.0;

    contract Registration {
        enum Status { Pending, Approved, Rejected }

        struct Application {
            string fullname;
            string email;
            string livingAddress;
            string gender;
            string userType;
            string vehicleName;
            string vehicleNumber;
            uint requestId;
            Status status;
            uint userId;
        }

        mapping(uint => Application) public applications;
        mapping(address => bool) public registeredUsers;
        uint public requestCounter = 0;
        uint public approvedUserCounter = 0;

        function registerUser(
            string memory fullname,
            string memory email,
            string memory livingAddress,
            string memory gender,
            string memory userType,
            string memory vehicleName,
            string memory vehicleNumber
        ) public payable {
            require(!registeredUsers[msg.sender], "User already registered.");

            requestCounter++;
            applications[requestCounter] = Application({
                fullname: fullname,
                email: email,
                livingAddress: livingAddress,
                gender: gender,
                userType: userType,
                vehicleName: vehicleName,
                vehicleNumber: vehicleNumber,
                requestId: requestCounter,
                status: Status.Pending,
                userId: 0
            });

            registeredUsers[msg.sender] = true;
        }

        function getApplicationDetails(uint requestId) public view returns (
            string memory fullname,
            string memory email,
            string memory livingAddress,
            string memory gender,
            string memory userType,
            string memory vehicleName,
            string memory vehicleNumber,
            string memory status,
            uint userId
        ) {
            Application memory app = applications[requestId];
            string memory statusStr = _statusToString(app.status);
            return (
                app.fullname,
                app.email,
                app.livingAddress,
                app.gender,
                app.userType,
                app.vehicleName,
                app.vehicleNumber,
                statusStr,
                app.userId
            );
        }

        function setApplicationStatus(uint256 requestId, bool isApproved) public {
            Application storage app = applications[requestId];

            if (isApproved) {
                require(app.status == Status.Pending, "Application already processed");
                app.status = Status.Approved;  // Approved
                
                // Assign a userId when approved
                approvedUserCounter++;
                app.userId = approvedUserCounter;
            } else {
                require(app.status == Status.Pending, "Application already processed");
                app.status = Status.Rejected;  // Rejected
            }
        }



        // New function to fetch all applications
        function getAllApplications() public view returns (
            Application[] memory
        ) {
            Application[] memory apps = new Application[](requestCounter);
            for (uint i = 1; i <= requestCounter; i++) {
                apps[i - 1] = applications[i];
            }
            return apps;
        }

        function _statusToString(Status status) private pure returns (string memory) {
            if (status == Status.Pending) return "Pending";
            if (status == Status.Approved) return "Approved";
            return "Rejected";
        }
    }
